  `account` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '账号',
  `wx_openid` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '微信用户唯一标识',
  `password` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '密码',
  `amount` decimal(10,0) NOT NULL DEFAULT '0' COMMENT '本金余额',
  `given_amount` decimal(10,0) NOT NULL DEFAULT '0' COMMENT '赠送余额',
  `consumption_amount` decimal(10,0) NOT NULL DEFAULT '0' COMMENT '消费金额',
  `consumption_number` int(11) NOT NULL DEFAULT '0' COMMENT '消费次数',
  `use_time` int(20) NOT NULL COMMENT '使用时长',
  `integral_number` int(11) NOT NULL DEFAULT '0' COMMENT '积分数',
  `login_flag` char(1) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '1' COMMENT '是否可登陆',
  `use_flag` char(1) NOT NULL COMMENT '是否可扫码',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '删除标记',
